import useRandomJoke from "./useRandomJoke";

function JokeGenerator() {
  const joke = useRandomJoke("jim", "bob");
  return (
    <div className="app">
      <center>
        <h1>The Joke Generator</h1>
        <h2> {joke} </h2>
        <button>Generate Joke</button>
      </center>
    </div>
  );
}

export default JokeGenerator;
